!function(){"use strict";$.getJSON(window.apiUrl+"/restaurants/list/"+window.username+"/?following=true",function(i){var e=$(".template").children().first().clone();$.each(i,function(i,n){var t=e.clone();t.find(".name").text(n.name),t.find(".price-range .low").text(n.price_low),t.find(".price-range .high").text(n.price_high),t.find(".address").text(n.location_name),t.find(".photo img").attr("src","images/"+n.photo),t.find(".photo, .info").wrap('<a href="restaurant.html?id='+n.id+'"></a>'),$(".main-div").append(t)})})}();